- input: "TEXT\x1CC00188367\x1CTEXT-00000\x1C\x1CF3XN\x1CSchedule A Line 15 reflects
    a number of receipts for the payment of rent, telephone and copies. The Democratic
    Party of Oregon shares office space with several organizations. We write one check
    to pay rent. The amount of rent paid by each organization is assessed at the usual
    and normal charge, determined by the amount of space occupied by the organization.
    Schedule A Line 15 reflects receipts from various County party and candidate committees.
    The Democratic Party of Oregon offers our County Committees and candidates a number
    of technology services at cost.  These services include website and email services.
    Payments for salaries and wages reported on Schedule H4 are for employees who
    spent less than 25% of their time on FEA or activities in connection with a Federal
    election. Employees who spend more than 25% of their time on FEA or activities
    in connection with a Federal election are paid with 100% Federal funds as are
    their fringe benefits and reported on Line 30b. Please note that the actual date
    of the Fundraising event reflected on the H2, Wayne Morse Gala 02.08.14 had to
    be changed from 02.08.14 to 04.25.14 due to severe weather in February. This report
    includes expenditures related to that event.\n"
